function leafext_make_overstyle(a){if(a.setStyle&&!a.options.mouseover){a.options.mouseover=!0;if(a.options.weight)a.options.origweight=a.options.weight,b=a.options.weight+2;else var b=5;if(a.options.fillOpacity)a.options.origfillOpacity=a.options.fillOpacity,c=a.options.fillOpacity+.2;else var c=.4;a.setStyle({fillOpacity:c,weight:b});a.bringToFront()}}
function leafext_make_styleback(a){a.setStyle&&a.options.mouseover&&(a.options.mouseover=!1,a.setStyle({fillOpacity:a.options.origfillOpacity?a.options.origfillOpacity:.2,weight:a.options.origweight?a.options.origweight:3}));"function"===typeof a.bringToBack&&a.bringToBack()};
